import React from 'react';
import NavCss from './Nav.module.css';


const Nav = () => {
    return (
        <React.Fragment>
            <nav className='NavCss.nav'>
                <a href="#">Profile</a>
                <a href="#">Messages</a>
                <a href="#">Music</a>
                <a href="#">Settings</a>
                HiperNav
            </nav> 
        </React.Fragment>
    );
}

export default Nav;
